item.solution:
var i,j,num,num1,ans:longint;
    k,m:ansistring;
begin
  //assign(input,'vigenere.in');
  //assign(output,'vigenere.out');
  //reset(input);
  //rewrite(output);
  readln(k);
  num:=length(k);
  k:=upcase(k);
  readln(m);
  num1:=length(m);
  i:=0;
  for j:=1 to num1 do
   begin
     if i<num then inc(i) else i:=1;
      ans:=ord(m[j])-ord(k[i])+ord('A');
     if ord(m[j])<ord('a') then
      begin
       if (ans<=ord('Z'))and(ans>=ord('A')) then m[j]:=chr(ans) else
        if ans<ord('A') then m[j]:=chr(ans+26) else m[j]:=chr(ans-26);;
      end
     else
      begin
       if (ans<=ord('z'))and(ans>=ord('a')) then m[j]:=chr(ans) else
       if ans<ord('a') then m[j]:=chr(ans+26) else m[j]:=chr(ans-26);;
      end;
   end;
  writeln(m);
  //close(input);
  //close(output);
end.
